import React, { useState, useEffect } from "react";
import * as s from "./styled-feed";
import { icons } from "../../assets";
import { getPosts } from "../../services";

export default ({}) => {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    console.log("postsApi");
    getPosts()
      .then((postsApi) => {
        setPosts(postsApi);
        console.log(postsApi);
      })
      .catch((e) => console.log(e));
  }, []);

  return (
    <s.PostList>
      <s.PostWrapper>
        <s.PostHeader>
          <s.UserInfo>
            <s.UserLabel>Dênian Closs</s.UserLabel>
            <s.PlaceLabel>Campo Bom</s.PlaceLabel>
          </s.UserInfo>

          <s.Icon height={5} src={icons.more} />
        </s.PostHeader>

        <img src="http://localhost:3333/file/sonico.jpg" />

        <s.PostFooter>
          <s.Actions>
            <s.Icon height={20} src={icons.like} alt="like" />
            <s.Icon height={20} src={icons.comment} alt="comment" />
            <s.Icon height={20} src={icons.send} alt="send" />
          </s.Actions>
          <strong>900 likes</strong>

          <s.PostDescription>
            um post muito foda!
            <s.PostHashTags>#react #foda #xandaoogod</s.PostHashTags>
          </s.PostDescription>
        </s.PostFooter>
      </s.PostWrapper>

      <s.PostWrapper>
        <s.PostHeader>
          <s.UserInfo>
            <s.UserLabel>Dênian Closs</s.UserLabel>
            <s.PlaceLabel>Campo Bom</s.PlaceLabel>
          </s.UserInfo>

          <s.Icon src={icons.more} />
        </s.PostHeader>

        <s.PostFooter>
          <s.Actions>
            <s.Icon height={20} src={icons.like} alt="like" />
            <s.Icon height={20} src={icons.comment} alt="comment" />
            <s.Icon height={20} src={icons.send} alt="send" />
          </s.Actions>
          <strong>900 likes</strong>

          <s.PostDescription>
            um post muito foda!
            <s.PostHashTags>#react #foda #xandaoogod</s.PostHashTags>
          </s.PostDescription>
        </s.PostFooter>
      </s.PostWrapper>
    </s.PostList>
  );
};
